.wrapper {
  display: grid;
  grid-template-columns: 30% 30% 40%;
  grid-template-rows: 30% 10% 40% 60%;
}
.grid-one {
  grid-column: 1 / 3;
  grid-row: 1 / 2;
}
.grid-two {
  grid-column: 3 / 4;
  grid-row: 1 / 5;
}
.grid-three {
  grid-column: 1 / 2;
  grid-row:  2 / 3 ;
}
.grid-four {
  grid-column: 1 / 3;
  grid-row: 3/ 4;
}
